import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { Form, Row, Col, Button } from "react-bootstrap"

export function SearchBar() {

    const navigate = useNavigate();

    const [Search, setSearch] = useState();

    function postSearchResult() {
        navigate('/SearchResult', {
            state: {
                SearchKey: Search
            }
        });
    }

    return (
        <div className="row h-100 justify-content-center align-items-center">
            <Form className="mt-4 me-3">
                <Row>
                    <Form.Group as={Row} className="mb-3" onSubmit={postSearchResult}>
                        <Col xs={11}>
                            <Form.Control type="text" placeholder="Search For Books" value={Search} onChange={e => setSearch(e.target.value)} />
                        </Col>
                        <Col xs={1}>
                            <Button>
                                <span className="material-symbols-outlined">
                                    search
                                </span>
                            </Button>
                        </Col>
                    </Form.Group>
                </Row>
            </Form>
        </div>
    )
}
